var $bm_rt;
var endctrl = thisComp.layer('left-Ankle');
var curveLin = $bm_div(endctrl.effect('Limber')('Bone Curvature'), 100);
if (curveLin === 0) {
    $bm_rt = createPath([
        endctrl.content('Admin').content('p1').transform.position,
        endctrl.content('Admin').content('p2blend').transform.position,
        endctrl.content('Admin').content('p3blend').transform.position
    ], [], [], 0);
} else {
    var angs = endctrl.content('Admin').content('angles').transform.anchorPoint;
    var avang = degreesToRadians($bm_div($bm_sub($bm_sum(angs[0], angs[1]), 180), 2));
    var linkScale = endctrl.effect('Limber')('Link Length to Size Scale');
    var tangLeng = $bm_mul($bm_div($bm_mul(curveLin, $bm_sum(endctrl(4)('Limber')('Upper Length'), endctrl.effect('Limber')('Lower Length'))), 2), linkScale == true ? endctrl.effect('Limber')('Size Scale') / 100 : 1);
    var tangPos = [
        Math.cos(avang) * tangLeng,
        Math.sin(avang) * tangLeng
    ];
    $bm_rt = createPath([
        endctrl.content('Admin').content('p1').transform.position,
        endctrl.content('Admin').content('p2blend').transform.position,
        endctrl.content('Admin').content('p3blend').transform.position
    ], [
        [
            0,
            0
        ],
        $bm_neg(tangPos),
        [
            0,
            0
        ]
    ], [
        [
            0,
            0
        ],
        tangPos,
        [
            0,
            0
        ]
    ], 0);
}

